    while (p):
        res *= 5
        p -= 1
    return res


def countNumbersUtil(N):
    count = 0
    digits = []
    while (N):
        digits .append(N % 10)
        N //= 10
    digits .reverse()
    D = len(digits)
    for i in range(1, D + 1, 1):
        res = getPower(i)
        if (i == D):
            for p in range(1, D + 1, 1):
                x = digits[p - 1]
                tmp = 0
                if (p % 2 == 0):
                    tmp = ((5 - (x // 2 + 1)) * getPower(D - p))
                else:
                    tmp = ((5 - (x + 1) // 2) * getPower(D - p))
                res -= tmp
                if (p % 2 != x % 2):
                    break
        count += res
    return count


