def lowerBound(array, length, value):
    if (length == 0)
        return -1;
    if (array[0] == value)
        return 0;
    if (array[length - 1] == value)
        return length - 1;
    int l = 0, r = length - 1;
    while (l < r) {
        int mid = (l + r) / 2;
        if (array[mid] < value)
            l = mid + 1;
        else
            r = mid;
    }
    if (array[l] == value)
        return l;
    if (array[r] == value)
        return r;
    return -1;


