    int length = sizeof(array) / sizeof(array[0]);
    int value = 1;
    int ans = lowerBound(array, length, value);
    if (ans == -1)
        cout << "No such value found";
    else
        cout << "Minimum cost to make all array elements equal is "
             << (ans + 1) * 2;
    return 0;
}

